

SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";




CREATE TABLE IF NOT EXISTS `components` (
`component_id` int(11) NOT NULL,
  `type_id` int(11) NOT NULL,
  `component_number` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `component_value` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `component_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `component_desc` text COLLATE utf8_unicode_ci,
  `component_img` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `component_ref_text` longtext COLLATE utf8_unicode_ci,
  `component_unit_price` double DEFAULT NULL,
  `component_stock_qty` int(11) DEFAULT NULL,
  `keywords` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `search_score` double NOT NULL
) ENGINE=InnoDB AUTO_INCREMENT=157 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;






CREATE TABLE IF NOT EXISTS `component_types` (
`type_id` int(11) NOT NULL,
  `type_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `parent_type_id` int(11) NOT NULL DEFAULT '0',
  `type_icon_img` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;





CREATE TABLE IF NOT EXISTS `datasheets` (
`datasheet_id` mediumint(9) NOT NULL,
  `component_number` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `datasheet_url` varchar(300) COLLATE utf8_unicode_ci DEFAULT NULL,
  `datasheet_content` blob
) ENGINE=InnoDB AUTO_INCREMENT=63 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;





ALTER TABLE `components`
 ADD PRIMARY KEY (`component_id`), ADD KEY `type_id` (`type_id`), ADD KEY `component_number` (`component_number`), ADD KEY `component_name` (`component_name`), ADD KEY `component_value` (`component_value`), ADD KEY `keywords` (`keywords`);


ALTER TABLE `component_types`
 ADD PRIMARY KEY (`type_id`), ADD KEY `parent_type_id` (`parent_type_id`);


ALTER TABLE `datasheets`
 ADD PRIMARY KEY (`datasheet_id`), ADD UNIQUE KEY `component_number` (`component_number`);


ALTER TABLE `components`
MODIFY `component_id` int(11) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=157;

ALTER TABLE `component_types`
MODIFY `type_id` int(11) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=11;

ALTER TABLE `datasheets`
MODIFY `datasheet_id` mediumint(9) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=63;

ALTER TABLE `components`
ADD CONSTRAINT `components_ibfk_1` FOREIGN KEY (`type_id`) REFERENCES `component_types` (`type_id`);

