(15, 8, 'TL072', 'TL072', 'TL072 - Low Noise Dual JFET Op-Amp', 'TL072 - Low Noise Dual JFET Op-Amp<br /><br /><p><strong>TPS-00101&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; TL072 - Low Noise Dual JFET Op-Amp&nbsp;&nbsp;&nbsp; </strong></p>    <p>Dual Low-Noise JFET-Input General-Purpose Operational Amplifier</p>    <p>Features</p>    <ul>  	<li>&nbsp;&nbsp;&nbsp; Low Power Consumption</li>  	<li>&nbsp;&nbsp;&nbsp; Wide Common-Mode and Differential Voltage&nbsp; Ranges</li>  	<li>&nbsp;&nbsp;&nbsp; Low Input Bias and Offset Currents</li>  	<li>&nbsp;&nbsp;&nbsp; Output Short-Circuit Protection</li>  	<li>&nbsp;&nbsp;&nbsp; Low Total Harmonic Distortion: 0.003% Typical</li>  	<li>&nbsp;&nbsp;&nbsp; Low Noise</li>  	<li>&nbsp;&nbsp;&nbsp; Vn = 18 nV/&radic;Hz Typ at f = 1 kHz</li>  	<li>&nbsp;&nbsp;&nbsp; High-Input Impedance: JFET Input Stage</li>  	<li>&nbsp;&nbsp;&nbsp; Internal Frequency Compensation</li>  	<li>&nbsp;&nbsp; &nbsp;Latch-Up-Free Operation</li>  	<li>&nbsp;&nbsp;&nbsp; High Slew Rate: 13 V/&micro;s Typical</li>  	<li>&nbsp;&nbsp;&nbsp; Common-Mode Input Voltage Range</li>  	<li>&nbsp;&nbsp;&nbsp; Includes VCC+</li>  </ul>    <p><strong>Package Type - 8 Pin DIP </strong></p>    <p>&nbsp;</p>', NULL, '<a href="http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_51&amp;products_id=101&amp;zenid=bd0dr85msat6972a17eil1nt70">http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_51&amp;products_id=101&amp;zenid=bd0dr85msat6972a17eil1nt70</a>', 15, 100, 'TL072 - Low Noise Dual JFET Op-Amp', 50.4),
(16, 7, 'FT232RL', 'FT232RL', 'FT232RL - USB to Serial UART interface', 'FT232RL - USB to Serial UART interface<br /><br /><p><strong>TPS-00124&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>FT232RL</strong></p>    <p>USB to serial UART interface</p>    <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Single chip USB to asynchronous serial data transfer interface.</p>    <p style="margin-left:.5in;">Entire USB protocol handled on the chip - No USB-specific firmware programming required.</p>    <p style="margin-left:.5in;">UART interface support for 7 or 8 data bits, 1 or 2 stop bits and odd / even / mark / space / no parity.</p>    <p style="margin-left:.5in;">Fully assisted hardware or X-On / X-Off software handshaking.</p>    <p style="margin-left:.5in;">Data transfer rates from 300 baud to 3 Megabaud (RS422 / RS485 and at TTL levels) and 300 baud to 1 Megabaud (RS232)</p>    <p style="margin-left:.5in;">In-built support for event characters and line break condition.</p>    <p style="margin-left:.5in;">New USB FTDIChip-ID&trade; feature.</p>    <p style="margin-left:.5in;">New configurable CBUS I/O pins.</p>    <p style="margin-left:.5in;">Auto transmit buffer control for RS485 applications.</p>    <p style="margin-left:.5in;">Transmit and receive LED drive signals.</p>    <p style="margin-left:.5in;">New 48MHz, 24MHz,12MHz, and 6MHz clock output signal Options for driving external MCU or FPGA.</p>    <p style="margin-left:.5in;">FIFO receive and transmit buffers for high data throughput.</p>    <p style="margin-left:.5in;">256 Byte receive buffer and 128 Byte transmit buffer utilising buffer smoothing technology to allow for high data throughput.</p>    <p style="margin-left:.5in;">Adjustable receive buffer timeout.</p>    <p style="margin-left:.5in;">Synchronous and asynchronous bit bang mode interface options with RD# and WR# strobes.</p>    <p style="margin-left:.5in;">New CBUS bit bang mode option.</p>    <p style="margin-left:.5in;">Integrated 1024 bit internal EEPROM for I/O configuration and storing USB VID, PID, serial number and product description strings.</p>    <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; Device supplied preprogrammed with unique USB serial number.</p>    <p style="margin-left:.5in;">Support for USB suspend / resume.</p>    <p style="margin-left:.5in;">Support for bus powered, self powered, and high-power bus powered USB configurations.</p>    <p style="margin-left:.5in;">Integrated 3.3V level converter for USB I/O .</p>    <p style="margin-left:.5in;">Integrated level converter on UART and CBUS for interfacing to 5V - 1.8V Logic.</p>    <p style="margin-left:.5in;">True 5V / 3.3V / 2.8V / 1.8V CMOS drive output and TTL input.</p>    <p style="margin-left:.5in;">High I/O pin output drive option.</p>    <p style="margin-left:.5in;">Integrated USB resistors.</p>    <p style="margin-left:.5in;">Integrated power-on-reset circuit.</p>    <table align="left" cellpadding="0" cellspacing="0" hspace="0" vspace="0">  	<tbody>  		<tr>  			<td align="left">  			<p style="margin-left:.5in;">Fully integrated clock - no external crystal, oscillator, or resonator required.</p>    			<p style="margin-left:.5in;">Fully integrated AVCC supply filtering - No separate AVCC pin and no external R-C filter required.</p>    			<p style="margin-left:.5in;">UART signal inversion option.</p>    			<p style="margin-left:.5in;">USB bulk transfer mode.</p>    			<p style="margin-left:.5in;">3.3V to 5.25V Single Supply Operation.</p>    			<p style="margin-left:.5in;">Low operating and USB suspend current.</p>    			<p style="margin-left:.5in;">Low USB bandwidth consumption.</p>    			<p style="margin-left:.5in;">UHCI / OHCI / EHCI host controller compatible.</p>    			<p style="margin-left:.5in;">USB 2.0 Full Speed compatible.</p>    			<p style="margin-left:.5in;">-40&deg;C to 85&deg;C extended operating temperature range.</p>  			</td>  		</tr>  	</tbody>  </table>    <div style="clear:both;">&nbsp;</div>    <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;28 Pin SSOP packages &nbsp;</p>    <p>&nbsp;</p>    <p>&nbsp;</p>    <p>&nbsp;</p>', NULL, '<a href="http://www.onlinetps.com/shop/integrated-circuits-ic/interfacing-and-driver-ics/ft232rl-usb-to-serial-uart-interface?zenid=nlatjrgo6a3lo4qf951iq0v387">http://www.onlinetps.com/shop/integrated-circuits-ic/interfacing-and-driver-ics/ft232rl-usb-to-serial-uart-interface?zenid=nlatjrgo6a3lo4qf951iq0v387</a>', 0, 100, 'FT232RL - USB to Serial UART interface', 50.2),
(17, 7, 'FT245RL', 'FT245RL', 'FT245RL -  USB to Parallel FIFO Interface', 'FT245RL -  USB to Parallel FIFO Interface<br /><br /><p><strong>TPS-00777&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>FT245RL</strong></p>    <p>USB FIFO interface Integrated Circuit Device</p>    <p><strong>features</strong></p>    <p style="margin-left:.5in;">Single chip USB to parallel FIFO bidirectional data transfer interface.</p>    <p style="margin-left:.5in;">Entire USB protocol handled on the chip - No USB-specific firmware programming required.</p>    <p style="margin-left:.5in;">Simple interface to MCU / PLD / FPGA logic with simple 4-wire handshake interface.</p>    <p style="margin-left:.5in;">Data transfer rate to 1 Megabyte / second - D2XX Direct Drivers.</p>    <p style="margin-left:.5in;">Data transfer rate to 300 kilobyte / second - VCP Drivers.</p>    <p style="margin-left:.5in;">FTDI&rsquo;s royalty-free VCP and D2XX drivers eliminate the requirement for USB driver development in most cases.</p>    <p style="margin-left:.5in;">New USB FTDIChip-ID&trade; feature.</p>    <p style="margin-left:.5in;">FIFO receive and transmit buffers for high data throughput.</p>    <p style="margin-left:.5in;">256 Byte receive buffer and 128 Byte transmit buffer utilising buffer smoothing technology to allow for high data throughput.</p>    <p style="margin-left:.5in;">Adjustable receive buffer timeout.</p>    <p style="margin-left:.5in;">Synchronous and asynchronous bit bang mode interface options with RD# and WR# strobes allow the data bus to be used as a general purpose I/O port.</p>    <p style="margin-left:.5in;">Integrated 1024 bit internal EEPROM for storing USB VID, PID, serial number and product description strings.</p>    <p style="margin-left:.5in;">Device supplied preprogrammed with unique USB serial number.</p>    <p style="margin-left:.5in;">Support for USB suspend / resume through PWREN# pin and Wake Up pin function.</p>    <p style="margin-left:.5in;">In-built