(29, 7, 'PL2303HX', 'PL2303HX', 'PL2303HX USB-to-Serial Bridge Controller', 'PL2303HX USB-to-Serial Bridge Controller<br /><br /><p><strong>TPS-00793&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>PL2303HX</strong></p>    <p>&nbsp;USB to Serial Bridge Controller</p>    <p>Features</p>    <p>&nbsp;</p>    <p>Fully Compliant with USB Specification v2.0 (Full-Speed)</p>    <p>On Chip USB 1.1 transceiver, 5V-&gt;3.3V regulator</p>    <p>On-chip 96MHz clock generator</p>    <p>Supports RS-422/RS-485 like serial interface (TXD, DTR_N, and RTS_N pins should be externally pulled-up to 5V)</p>    <p>Supports RS232-like Serial Interface</p>    <p>Full-duplex transmitter and receiver (TXD and RXD)</p>    <p>&nbsp;&nbsp;&nbsp;&nbsp; Six MODEM control pins (RTS, CTS, DTR, DSR, DCD, and RI)</p>    <p>&nbsp;&nbsp;&nbsp;&nbsp; 5, 6, 7 or 8 data bits</p>    <p>Odd, Even, Mark, Space, or None parity mode</p>    <p>One, one and a half, or two stop bits</p>    <p>Parity error, frame error, and serial break detection</p>    <p>Programmable baud rate from 75 bps to 12M bps</p>    <p>External RS232 driver power down control</p>    <p>Independent power source for serial interface</p>    <p>Extensive Flow Control Mechanism</p>    <p>Adjustable high/low watermark level</p>    <p>Automatic hardware flow control with CTS/RTS or DSR/DTR</p>    <p>Automatic software flow control with XON/XOFF</p>    <p>Inbound data buffer overflow detection</p>    <p>Configurable 512-byte bi-directional data buffer</p>    <p>256-byte outbound buffer and 256-byte inbound buffer; or</p>    <p>128-byte outbound buffer and 384-byte inbound buffer</p>    <p>Supports remote wake-up from MODEM input signals</p>    <p>Four (4) General Purpose I/O (GP0, GP1, GP2,&amp; GP3) pins &amp; Four (4) Auxiliary General</p>    <p>Purpose I/O (RI_N, DSR_N, DCD_N, &amp; CTS_N) pins.</p>    <p>On-chip OTP (One Time Programming) ROM for startup device configurations</p>    <p>Hardware backward compatible with PL-2303H</p>    <p>Provides drivers support for Windows, Mac OS, Linux, and WinCE</p>    <p>Windows XP Certified Logo Drivers</p>    <p>(x86 driver only)</p>    <p>Windows Vista Certified Logo Drivers</p>    <p>(x86 and x64 drivers)</p>    <p>USB-IF Logo Compliant with TID 40000100</p>    <p>Small footprint 28-pin SSOP &nbsp;package</p>    <p>&nbsp;</p>', NULL, '<a href="http://www.onlinetps.com/shop/integrated-circuits-ic/interfacing-and-driver-ics/pl2303hx-usb-to-serial-bridge-controller?zenid=nlatjrgo6a3lo4qf951iq0v387">http://www.onlinetps.com/shop/integrated-circuits-ic/interfacing-and-driver-ics/pl2303hx-usb-to-serial-bridge-controller?zenid=nlatjrgo6a3lo4qf951iq0v387</a>', 0, 100, 'PL2303HX USB-to-Serial Bridge Controller', 50),
(30, 7, 'SN75176', 'SN75176', 'SN75176 Differential Bus Transceiver', 'SN75176 Differential Bus Transceiver<br /><br /><p><strong>TPS-00684&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>SN75176</strong></p>    <p>SN75176 Differential Bus Transceiver</p>    <p>Features</p>    <ul>  	<li>Bidirectional Transceiver</li>  	<li>3-State Driver and Receiver Outputs</li>  	<li>Individual Driver and Receiver Enables</li>  	<li>Operates From Single 5-V Supply</li>  	<li>Lower Power Requirements</li>  	<li>Driver Positive-Current Limiting and Negative- Current Limiting</li>  </ul>    <p>&nbsp;</p>    <p>Package Type - 8 Pin DIP</p>    <p>&nbsp;</p>', NULL, '<a href="http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_91&amp;products_id=684&amp;zenid=nlatjrgo6a3lo4qf951iq0v387">http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_91&amp;products_id=684&amp;zenid=nlatjrgo6a3lo4qf951iq0v387</a>', 0, 100, 'SN75176 Differential Bus Transceiver', 50),
(31, 7, 'UDN2981', 'UDN2981', 'UDN2981 8-Channel Source Drivers', 'UDN2981 8-Channel Source Drivers<br /><br /><p><strong>TPS-01397&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>UDN2981</strong></p>    <p>8-CHANNEL SOURCE DRIVERS</p>    <p>FEATURES</p>    <p>&nbsp;</p>    <ul>  	<li>TTL, DTL, PMOS, or CMOS Compatible Inputs</li>  	<li>500 mA Output Source Current Capability</li>  	<li>Transient-Protected Outputs</li>  	<li>Output Breakdown Voltage to 80 V</li>  	<li>DIP 18 Pin Packaging</li>  </ul>    <p style="margin-left:.5in;">&nbsp;</p>    <p>Package Type - 20 Pin DIP</p>', NULL, '<a href="http://www.onlinetps.com/shop/integrated-circuits-ic/interfacing-and-driver-ics/udn2981-8-channel-source-drivers?zenid=nlatjrgo6a3lo4qf951iq0v387">http://www.onlinetps.com/shop/integrated-circuits-ic/interfacing-and-driver-ics/udn2981-8-channel-source-drivers?zenid=nlatjrgo6a3lo4qf951iq0v387</a>', 0, 100, 'UDN2981 8-Channel Source Drivers', 50.2),
(74, 6, 'CD4001', 'CD4001', 'CD4001 - Quad 2 Input NOR Gate', 'CD4001 - Quad 2 Input NOR Gate<br /><br /><p><strong>TPS-00018&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; CD4001</strong></p>    <p>&nbsp;</p>    <ul>  	<li><strong>CD4001 Quad 2-Input NOR Buffered Gate</strong></li>  	<li><strong>Low power TTL compatibility </strong></li>  	<li><strong>Operating Range (VCC-Pin-14)&nbsp;&nbsp;&nbsp;&nbsp; 3 VDC-15 VDC</strong></li>  	<li><strong>VSS &ndash; Ground(0V-Pin-7)</strong></li>  	<li><strong>Operating temperature range -40 C&nbsp; to&nbsp; 85 C</strong></li>  </ul>    <p>&nbsp;</p>    <p><strong>Power Dissipation (DIP)&nbsp; - 500mW</strong></p>    <p><font face="verdana,arial,helvetica,sans-serif">find related circuits here</font><br />  <font size="3"><span style="font-family: verdana,arial,helvetica,sans-serif;"><a href="http://www.eleccircuit.com/cd4001-light-detector-circuit/" target="_blank">light-detector-circuit</a><br />  <a href="http://www.coolcircuit.com/circuit/4001/index.html" style="color: rgb(0, 0, 255);" target="_blank">Small circuits</a><br />  <a href="http://www.coolcircuit.com/circuit/sound_gen_with_4001/index.html" target="_blank">sound generator</a></span></font></p>    <p>&nbsp;</p>', NULL, '<a href="http://www.onlinetps.com/shop/integrated-circuits-ic/4000-series-ics/cd4001-quad-2-input-nor-gate?zenid=hrt2ge7oiuk9js80frvcm0cqo7">http://www.onlinetps.com/shop/integrated-circuits-ic/4000-series-ics/cd4001-quad-2-input-nor-gate?zenid=hrt2ge7oiuk9js80frvcm0cqo7</a>', 21, 100, 'CD4001 - Quad 2 Input NOR Gate', 96.30000000000005),
(75, 6, 'CD4007', 'CD4007', 'CD4007 - Dual Complementary Pair Inverter', 'CD4007 - Dual Complementary Pair Inverter<br /><br /><p><strong>TPS-00019&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong> <font size="3">CD4007 - Dual Complementary Pair Inverter</font></p>    <p>The CD4007 multi-purpose device consists of three N-channel and three P-channel enhancement mode devices packaged to provide access to each device. These versatile parts are useful in inverter circuits, pulse-shapers, linear amplifiers, high input impedance amplifiers, threshold detectors, transmission gating, and functional gating.</p>    <table border="0" cellpadding="0" cellspacing="0">  	<tbody>  		<tr>  			<td>  			<ul>  				<li>Diode Protection on All Inputs</li>  			</ul>  			</td>  		</tr>  		<tr>  			<td>  			<ul>  				<li>Supply Voltage Range = 3.0 Vdc to 18 Vdc</li>  			</ul>  			</td>  		</tr>  		<tr>  			<td>  			<ul>  				<li>Capable of Driving Two Low-power TTL Loads or One Low-power Schottky TTL Load Over the Rated Temperature Range</li>  			</ul>  			</td>  		</tr>  		<tr>  			<td>  			<ul>  				<li>Pin-for-Pin Replacement for CD4007A or CD4007UB</li>  			</ul>  			</td>  		</tr>  		<tr>  			<td>  			<ul>  				<li>This device has 2 outputs without ESD Protection. Anti-static precautions must be taken.</li>  			</ul>  			</td>  		</tr>  		<tr>  			<td>  			<ul>  				<li>Pb-Free Packages are Available*</li>  			</ul>  			</td>  		</tr>  	</tbody>  </table>    <p>&nbsp;</p>    <p><br />  <br />  <font size="3">find related circuits here&nbsp;&nbsp; </font><font size="3"><font face="verdana,arial,helvetica,sans-serif"><a href="http://www.electronicecircuits.com/electronic-circuits/touch-controlled-amplifier/"><span style="color: rgb(51, 51, 204);">touch controlled amplifier</span></a></font></font></p>    <p>&nbsp;</p>', NULL, '<a href="http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_23&amp;products_id=19&amp;zenid=hrt2ge7oiuk9js80frvcm0cqo7">http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_23&amp;products_id=19&amp;zenid=hrt2ge7oiuk9js80frvcm0cqo7</a>', 21, 100, 'CD4007 - Dual Complementary Pair Inverter', 87.80000000000025),
(76, 6, 'CD4009', 'CD4009', 'CD4009 - CMOS Hex Buffers/Converter', 'CD4009 - CMOS Hex Buffers/Converter<br /><br /><p><strong>TPS-00663&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;CD4009 - CMOS Hex Buffers/Converter</strong></p>    <p><strong>General Description</strong></p>    <p>These hex buffers are monolithic complementary MOS (CMOS) integrated circuits The N- and P-channel enhancement mode transistors provide a symmetrical circuit with output swings essentially equal to the supply voltage This results in high noise immunity over a wide supply voltage range No DC power other than that caused by leakage current is consumed during static conditions All inputs are protected against static discharge These gates may be used as hex buffers CMOS to DTL or TTL interface or as CMOS current drivers Conversion ranges are from 3V to 15V providing VCC &lt;=VDD</p>    <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>    <p>&nbsp;</p>    <p><strong>Features</strong></p>    <p>Wide supply voltage range&nbsp; 3.0V to 15V</p>    <p>Low power 100 nW (typ)</p>    <p>High noise immunity 0.45 VDD (typ)</p>    <p>High current sinking capability 8mA (min) at VO = 0.5V and VDD = 10V</p>    <p>&nbsp;</p>    <p><strong>Applications</strong></p>    <p>Automotive, Alarm system, Data terminals, Industrial controls, Instrumentation</p>    <p>Remote metering, Medical electronics, Computers</p>    <p>&nbsp;</p>', NULL, '<a href="http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_23&amp;products_id=663&amp;zenid=hrt2ge7oiuk9js80frvcm0cqo7">http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_23&amp;products_id=663&amp;zenid=hrt2ge7oiuk9js80frvcm0cqo7</a>', 21, 100, 'CD4009 - CMOS Hex Buffers/Converter', 126.40000000000006),
(77, 6, 'CD40106', 'CD40106', 'CD40106 - Hex Schmitt Trigger', 'CD40106 - Hex Schmitt Trigger<br /><br /><p><strong><a href="http://www.datasheetcatalog.org/datasheets/270/108596_DS.pdf ">&nbsp;</a><font size="3">CD40106 - Hex Schmitt Trigger</font></strong></p>    <p><strong>TPS-00020&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<font size="3">CD40106 - Hex Schmitt Trigger</font></strong></p>    <p><strong>General Description</strong></p>    <p>The CD40106B Hex Schmitt Trigger is a monolithic complementary MOS (CMOS) integrated circuit constructed with N and P-channel enhancement transistors. All inputs are protected from damage due to static discharge by diode clamps to VDD and VSS.</p>    <p>Wide supply voltage range 3V to 15V</p>    <p>High noise immunity 0.7 VDD</p>    <p>Low power TTL compatibility</p>    <p><br />  <font size="3">find related circuits here</font><br />  <font size="3"><a href="http://www.eleccircuit.com/coil-less-fm-transmitter-by-ic-40106/" rel="bookmark" target="_blank" title="Permanent Link to Coil-less FM Transmitter by IC 40106">Coil-less FM Transmitter by IC 40106</a></font><br />  &nbsp;</p>', NULL, '<a href="http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_23&amp;products_id=20&amp;zenid=hrt2ge7oiuk9js80frvcm0cqo7">http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_23&amp;products_id=20&amp;zenid=hrt2ge7oiuk9js80frvcm0cqo7</a>', 21, 100, 'CD40106 - Hex Schmitt Trigger', 114.10000000000002);
