(78, 6, 'CD4011', 'CD4011', 'CD4011 - Quad 2-Input NAND Gate', 'CD4011 - Quad 2-Input NAND Gate<br /><br /><p><strong>TPS-00048&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; CD4011</strong></p>    <p>CD4011 Quad 2-Input NAND Gate</p>    <h3>Features</h3>    <ul>  	<li>Four Independent 2-input NAND Gates</li>  	<li>Standard Pin Configuration (DIP)</li>  	<li>Wide Operating Voltage Range (3v-18v)</li>  	<li>Operating Temperature to 85C</li>  	<li>Low Power TTL</li>  </ul>    <p><a href="http://www.datasheetcatalog.org/datasheets/208/108647_DS.pdf"><font face="verdana,arial,helvetica,sans-serif">CD4011 - Quad 2-In NAND Gate</font><br />  <br />  <font size="3">find related circuits here</font></a><font face="verdana,arial,helvetica,sans-serif"><a href="http://www.coolcircuit.com/circuit/4011/" style="color: rgb(51, 51, 204);">&nbsp; Touch switcp</a><br />  <span style="color: rgb(51, 51, 204);">Touch switch2</span></font></p>    <p>&nbsp;</p>', NULL, '<a href="http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_23&amp;products_id=48&amp;zenid=hrt2ge7oiuk9js80frvcm0cqo7">http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_23&amp;products_id=48&amp;zenid=hrt2ge7oiuk9js80frvcm0cqo7</a>', 21, 100, 'CD4011 - Quad 2-Input NAND Gate', 118.39999999999999),
(79, 6, 'CD4013', 'CD4013', 'CD4013 - Dual D Flip-Flop', 'CD4013 - Dual D Flip-Flop<br /><br /><p><strong>TPS-00021&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; CD4013</strong></p>    <p>CD4013 Dual D-type Flip-Flops with Set/Reset</p>    <h3>Features</h3>    <ul>  	<li>Two Independent Flip-Flops with Set, Reset and Clock Inputs</li>  	<li>Standard Pin Configuration</li>  	<li>Wide Operating Voltage Range (3v-15v)</li>  	<li>Operating Temperature to 85C</li>  	<li>Low Power TTL</li>  </ul>    <p><br />  <br />  <font face="verdana,arial,helvetica,sans-serif">find related circuits here<br />  <font size="2"><font size="3"><a href="http://www.eleccircuit.com/ultrasonic-pest-repellent-by-cd4013/" style="color: rgb(51, 51, 255);">Ultrasonic pest repellent</a></font></font></font></p>', NULL, '<a href="http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_23&amp;products_id=21&amp;zenid=hrt2ge7oiuk9js80frvcm0cqo7">http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_23&amp;products_id=21&amp;zenid=hrt2ge7oiuk9js80frvcm0cqo7</a>', 21, 100, 'CD4013 - Dual D Flip-Flop', 63.499999999999986),
(80, 6, 'CD4016', 'CD4016', 'CD4016 - Quad Analog Switch Quad Multiplexer', 'CD4016 - Quad Analog Switch Quad Multiplexer<br /><br /><p><strong>TPS-00022&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; CD4016</strong></p>    <p>CD4016 Quad Bilateral Switch</p>    <h3>Features</h3>    <ul>  	<li>Quad Bilateral Switch for the Transmission or Multiplexing or Analog or Digital Signals</li>  	<li>High Frequency Response to 40MHz</li>  	<li>Wide Operating Voltage Range (3v-15v)</li>  	<li>Operating Temperature to 85C</li>  	<li>Low Power TTL</li>  </ul>    <p><a href="http://pdf1.alldatasheet.com/datasheet-pdf/view/11947/ONSEMI/CD4016.html" target="_blank"><font face="verdana,arial,helvetica,sans-serif">CD4016 - Quad Analog Switch Quad Multiplexer<br />  <br />  see related circuits here</font></a><br />  <a href="http://81.227.203.107/audio/stereo_enc.htm"><font size="2">Stereo Coder</font></a></p>', NULL, '<a href="http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_23&amp;products_id=22&amp;zenid=hrt2ge7oiuk9js80frvcm0cqo7">http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=12_23&amp;products_id=22&amp;zenid=hrt2ge7oiuk9js80frvcm0cqo7</a>', 21, 100, 'CD4016 - Quad Analog Switch Quad Multiplexer', 59.19999999999997),
