(116, 9, '2N2222', '2N2222', '2N2222 Transistor - Metal Package', '2N2222 Transistor - Metal Package<br /><br />The 2N2222 is a common NPN bipolar junction transistor used for general purpose low-power amplifying or switching applications. It is designed for low to medium current, low power, medium voltage, and can operate at moderately high speeds.', NULL, '<a href="http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=114_21&amp;products_id=531&amp;zenid=cbuci7c4s96h83p7trqir2ap56">http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=114_21&amp;products_id=531&amp;zenid=cbuci7c4s96h83p7trqir2ap56</a>', 20, 100, '2N2222 Transistor - Metal Package', 60.2),
