(147, 9, 'ML187', 'ML187', 'ML187 Transistor - Plastic Package (Pack of 5)', 'ML187 Transistor - Plastic Package (Pack of 5)<br /><br />ML187 Transistor - Plastic Package (Pack of 5)', NULL, '<a href="http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=114_21&amp;products_id=1354&amp;zenid=cbuci7c4s96h83p7trqir2ap56">http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=114_21&amp;products_id=1354&amp;zenid=cbuci7c4s96h83p7trqir2ap56</a>', 0, 100, 'ML187 Transistor - Plastic Package (Pack of 5)', 50),
(148, 9, 'S8050/S8550', 'S8050/S8550', 'S8050/S8550 Transistor - Plastic Package (Pack of 5)', 'S8050/S8550 Transistor - Plastic Package (Pack of 5)<br /><br /><p>The UTC S8550 is a low voltage high current small signal&nbsp; PNP transistor, designed for Class B push-pull&nbsp; audio amplifier and general purpose applications.&nbsp;&nbsp;<br />  FEATURES<br />  *Collector current up to 700mA<br />  *Collector-Emitter voltage up to 20 V<br />  *Complementary to UTC S8050</p>', NULL, '<a href="http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=114_21&amp;products_id=552&amp;zenid=cbuci7c4s96h83p7trqir2ap56">http://www.onlinetps.com/shop/index.php?main_page=product_info&amp;cPath=114_21&amp;products_id=552&amp;zenid=cbuci7c4s96h83p7trqir2ap56</a>', 0, 100, 'S8050/S8550 Transistor - Plastic Package (Pack of 5)', 50),
(149, 9, 'SL100', 'SL100', 'SL100 Transistor - Metal Package', 'SL100 Transistor - Metal Package<br /><br /><p><em>SL100</em> is a general purpose, medium power NPN <em>transistor</em>. It is mostly used as switch in common emitter configuration.</p>', NULL, '<a href="http://www.onlinetps.com/shop/transistors-and-mosfet/transistors/sl100-transistor-metal-package?zenid=cbuci7c4s96h83p7trqir2ap56">http://www.onlinetps.com/shop/transistors-and-mosfet/transistors/sl100-transistor-metal-package?zenid=cbuci7c4s96h83p7trqir2ap56</a>', 15, 100, 'SL100 Transistor - Metal Package', 50),
(150, 9, 'ST13005', 'ST13005', 'ST13005 High voltage fast-switching NPN power Transistor', 'ST13005 High voltage fast-switching NPN power Transistor<br /><br /><p>Features ? Low spread of dynamic parameters ? Minimum lot-to-lot spread for reliable operation ? Very high switching speed Applications ? Electronic ballast for fluorescent lighting ? Switch mode power supplies Description This device is manufactured using high voltage multi epitaxial planar technology for high switching speeds and high voltage capability. It uses a cellular emitter structure with planar edge termination to enhance switching speeds while maintaining a wide RBSOA.</p>', NULL, '<a href="http://www.onlinetps.com/shop/transistors-and-mosfet/transistors/st13005-high-voltage-fast-switching-npn-power-transistor?zenid=cbuci7c4s96h83p7trqir2ap56">http://www.onlinetps.com/shop/transistors-and-mosfet/transistors/st13005-high-voltage-fast-switching-npn-power-transistor?zenid=cbuci7c4s96h83p7trqir2ap56</a>', 0, 100, 'ST13005 High voltage fast-switching NPN power Transistor', 51),
(151, 9, 'ST13007', 'ST13007', 'ST13007 High voltage fast-switching NPN power Transistor', 'ST13007 High voltage fast-switching NPN power Transistor<br /><br /><p>Features ? DC current gain classification ? High voltage capability ? Low spread of dynamic parameters ? Very high switching speed Applications ? Electronic ballast for fluorescent lighting ? Switch mode power supplies Description The device is manufactured using high voltage multi-epitaxial planar technology for high switching speeds and high voltage capability. It uses a cellular emitter structure with planar edge termination to enhance switching speeds while maintaining the wide RBSOA.</p>', NULL, '<a href="http://www.onlinetps.com/shop/transistors-and-mosfet/transistors/st13007-high-voltage-fast-switching-npn-power-transistor?zenid=cbuci7c4s96h83p7trqir2ap56">http://www.onlinetps.com/shop/transistors-and-mosfet/transistors/st13007-high-voltage-fast-switching-npn-power-transistor?zenid=cbuci7c4s96h83p7trqir2ap56</a>', 0, 100, 'ST13007 High voltage fast-switching NPN power Transistor', 50.9),
(152, 9, 'TIP122', 'TIP122', 'TIP122 Transistor - Plastic Package', 'TIP122 Transistor - Plastic Package<br /><br /><p>NPN Epitaxial Darlington <em>Transistor</em>.<br />  &nbsp;&bull; Medium Power Linear Switching Applications.<br />  &nbsp;&bull; Complementary to TIP125/126/127</p>', NULL, '<a href="http://www.onlinetps.com/shop/transistors-and-mosfet/transistors/tip122-transistor-plastic-package?zenid=cbuci7c4s96h83p7trqir2ap56">http://www.onlinetps.com/shop/transistors-and-mosfet/transistors/tip122-transistor-plastic-package?zenid=cbuci7c4s96h83p7trqir2ap56</a>', 20, 100, 'TIP122 Transistor - Plastic Package', 50.8),
